        self.label_3.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">Dokterku</span><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">, Jakarta - Mengonsumsi makanan bergizi erat kaitannya dengan hidup sehat. Pasalnya, pola makan yang tepat dapat membantu mencapai berat badan ideal dan mengurangi risiko penyakit kronis seperti diabetes, kardiovaskular, dan jenis kanker lainnya.</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Mengonsumsi makanan bergizi tidak hanya meningkatkan kesehatan fisik, tetapi juga suasana hati. Nutrisi yang baik, aktivitas fisik, dan berat badan yang sehat adalah bagian penting dari mendapatkan hidup sehat yang berkualitas.</span><br/></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">Memilih Makanan Bergizi</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Mengonsumsi makanan bergizi bukan berarti kamu harus menghilangkan makanan yang kamu sukai. Landasan pola makan sehat adalah mengganti makanan olahan dengan makanan sungguhan. </span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Pola makan sehat adalah keseimbangan antara protein, lemak, karbohidrat, serat, vitamin, dan mineral. Kamu tidak perlu menghilangkan kategori makanan tertentu dari dietmu, tetapi memilih opsi paling sehat dari setiap kategori. Karena semuanya memang dibutuhkan oleh tubuh.</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">1. Protein </span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Makanan berprotein bisa memberikan manfaat baik untuk tubuhmu, sekaligus mendukung suasana hati dan fungsi kognitif yang baik. Namun, terlalu banyak mengonsumsi protein juga bisa berbahaya bagi pengidap penyakit ginjal. Selain itu, perlu diketahui juga sumber protein tidak hanya berasal dari produk hewani, tetapi juga nabati. </span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">2. Lemak</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Tidak semua lemak itu sama. Lemak jahat dapat merusak pola makan dan meningkatkan risiko penyakit tertentu. Sedangkan lemak baik melindungi otak dan jantung. Faktanya, lemak sehat seperti omega-3 sangat penting untuk kesehatan fisik dan emosional. Memasukkan lebih banyak lemak sehat dalam pola makanmu dapat membantu meningkatkan suasana hati, bahkan memangkas lingkar di pinggang.</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">3. Serat</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Makan makanan tinggi serat seperti biji-bijian, buah, sayuran, kacang-kacangan, dan kacang-kacangan, dapat membantu menurunkan risiko penyakit jantung, stroke, dan diabetes. Tidak hanya itu saja, makanan yang mengandung serat juga dapat bermanfaat bagi kulit, bahkan membantu menurunkan berat badan.</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">4. Kalsium</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Selain menyebabkan osteoporosis, tidak mendapatkan cukup kalsium dalam makanan juga dapat menyebabkan kecemasan, depresi, dan kesulitan tidur. Keju, yogurt, almond, tahu adalah jenis makanan yang mengandung kalsium.</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; font-weight:600; color:#000000; background-color:transparent;\">5. Karbohidrat</span></p><p align=\"justify\"><span style=\" font-family:\'Nunito,sans-serif\'; font-size:14pt; color:#000000; background-color:transparent;\">Karbohidrat adalah salah satu sumber energi utama tubuh. Karbohidrat kompleks seperti sayuran, biji-bijian, dan buah lebih disarankan untuk dikonsumsi ketimbang produk olahan. Mengurangi konsumsi roti putih, kue kering, pati, dan gula dapat mencegah lonjakan gula darah, fluktuasi suasana hati dan energi, dan penumpukan lemak, terutama di sekitar lingkar pinggang.</span></p></body></html>"))
